        a[i], a[j] = a[j], a[i]
        b[i], b[j] = b[j], b[i]

    def preprocess_moves(a: List[str], b: List[str]) -> None:
        for i in range(n // 2):
            if a[i]!= b[i]:
                break
        else:
            return

        for i in range(n - 1):
            if a[i] == a[n - i - 1]:
                continue
            elif a[i] == b[i]:
                swap_and_reverse(a, i, n - i - 1)
            else:
                break
            a[i], a[n - i - 1] = a[n - i - 1], a[i]
            if a[i]!= b[i]:
                break
        else:
            return

        for i in range(n - 1):
            if b[i] == b[n - i - 1]:
                continue
            elif b[i] == a[i]:
                swap_and_reverse(b, i, n - i - 1)
            else:
                break
            b[i], b[n - i - 1] = b[n - i - 1], b[i]
            if b[i]!= a[i]:
                break
        else:
            return

        if a[n // 2]!= b[n // 2]:
            swap_and_reverse(a, n // 2, n - 1)

    preprocess_moves(a, b)
    return len(a) - len(b)

