        return "Invalid input"
    if A[0] == X or A[N - 1] == X:
        return "Invalid input"

    def in_toll_gate(x: int) -> bool:
        return x == 0 or x == X or x == N

    def travel(x: int, target: int) -> int:
        if x == target:
            return 0
        if in_toll_gate(x) and target - x > 0:
            return 1
