    A = list(map(int, stdin.strip().split()))
    B = list(map(int, stdin.strip().split()))
    C = list(map(int, stdin.strip().split()))

    def get_category(part):
        if part >= 10**9:
            return 'upper'
        elif part >= 500:
            return'middle'
        else:
            return 'lower'

    def get_parts(altar):
        parts = []
        for i in range(3):
            category = get_category(altar[i])
            if category == 'upper':
                parts.append(altar[i])
            elif category =='middle':
                if i < 2:
                    parts.append(altar[i+1])
                else:
                    parts.append(altar[i-1])
            elif category == 'lower':
                if i < 2:
                    parts.append(altar[i+1])
                else:
                    parts.append(altar[i-1])
        return parts

    def can_build_altar(parts):
        count = 0
        for i in range(3):
            for j in range(i+1, 3):
                if get_category(parts[i]) == get_category(parts[j]):
                    count += 1
                    if count > 1:
                        return False
        return True

    result = 0
    for i in range(1, N):
        parts_i = get_parts(A[i-1:i+1])
        parts_j = get_parts(B[i-1:i+1])
        parts_k = get_parts(C[i-1:i+1])
        if not can_build_altar(parts_i + parts_j + parts_k):
            result += 1

    return str(result)

